    const { author, title, description, urlToImage } = props.uNew;

    if (urlToImage === '') return null;

    return (
        <div className="col-md-6 col-12 mb-4">
        <div className="card-header">
            <h4>{title}</h4>
        </div>
            <div className="card-body">
                {description}
            </div>
        </div>
    )
}

export default UNew;
